pragma solidity ^0.8.24;

interface IRestaurantManager {
    function initialize(address foodApp, address factoryOwner) external;

    function registerRestaurant(address caller) external returns (uint128);
    function restaurantExists(uint128 restaurantId) external view returns (bool);
    //===== Hàm Get ===================
    function getRestaurantOwner(uint128 restaurantId) external view returns (address);

}

structs/FoodTypes.sol.content:
// SPDX-License-Identifier: MIT
pragma solidity ^0.8.24;

enum Role { None, Admin, Customer, FOH, BOH } // FOH: Front of House, BOH: Back of House

enum OrderStatus { Placed, Confirmed, Preparing, Ready, Delivered, Completed, Cancelled }

struct MenuItem {
    uint128 id;
    uint128 restaurantId;
    string name;
    string menuTitle;
    uint128 price;
    bool available;
    string description;
    string category;
    uint128 totalRating; 
    uint128 ratingCount; 
    uint128 preparationTime;
}

struct UpdateMenuItemParams {
    uint128 restaurantId;
    uint128 menuId;
    string name;
    string menuTitle;
    uint128 price;
    bool available;
    string description;
    string category;
    uint128 preparationTime;
    uint128 totalRating; 
    uint128 ratingCount;
}

struct OrderItemDetail {
    uint128 menuItemId;
    string name;
    uint128 pricePerUnit;
    uint128 quantity;
}

struct Order {
    uint128 id;
    address customer;
    uint128 restaurantId;
    OrderItemDetail[] itemsDetail;
    uint256 totalPrice;
    OrderStatus status;
    uint128 timestamp;
    uint128 preparationTime; 
    uint128 quantity;
}

struct Restaurant {
    uint128 id;
    address owner; 
    string name;
    // Thêm các trường khác
}

struct Review {
    uint128 id;
    address customer;
    address staff;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct StaffReview {
    uint128 id;
    address customer;
    address staff;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct MenuItemReview {
    uint128 id;
    address customer;
    uint128 menuItemId;
    uint128 restaurantId;
    uint8 rating;
    string comment;
    uint128 timestamp;
}

struct UserProfile {
    address userAddress; 
    string name;
    string phoneNumber;
    string email; 
    string imageUrl;
    bool isActive; 
    uint128 registrationDate;
}
struct RestaurantStaffMember {
    address staffAddress; 
    Role staffRole;       
    uint128 restaurantId; 
    uint128 assignmentDate;
}

